import React from 'react';

const Education = () => (
  <div>
    <h2>Education</h2>
    <p>2020 – 2022 Toulouse School of Economics – Toulouse, France</p>
    <p>M.Sc. in Econometrics and Statistics</p>
    <p>2015 – 2020 Ozyegin University – Istanbul, Turkey</p>
    <p>B.A. in Economics</p>
    <p>2017 – 2018 Free University of Bolzano – Bolzano, Italy (Exchange student)</p>
    <p>Economics and Social Sciences</p>
    <p>2011 – 2015 Kabataş Erkek Lisesi – Istanbul, Turkey</p>
    <p>High School Diploma</p>
  </div>
);

export default Education;
